import './App.css';
import { BroswerRouter as Router, Route, Switch, Link} from 'react-router-dom';
import Home from "./pages/Home";

// should only keep the route information, not the content.

function App() {

  return (
    <div className="App"> 
      <Router>
        <Switch>
          <Route path="/" exact component={Home} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
